    var suma_total = suma_buys + suma_sells;







    return( 
        <tr>
          <th scope="row">{}</th>
          <td>{exchanges[0]}</td>
          <td>{}</td>
          <td>{suma_sells}</td>
          <td>{suma_buys}</td>
          <td>{suma_total}</td>
        </tr>

    )

};

export default Exchanges;
